import React from 'react';
import CoverImga from "../../Assests/Images/background/bg-1.png";
import CoverImgb from "../../Assests/Images/background/2.png";
import CoverImgc from "../../Assests/Images/background/1.png";


function MiddleBanner() {
    return (
        <div id="carouselExampleInterval" class="carousel carousel-dark slide" data-bs-ride="carousel">
        <div class="carousel-inner">
          <div class="carousel-item active" data-bs-interval="10000">
            <img src="https://zom-in.com/images/banner/homepage-banner/bp-dawn-adaptive-more-info.jpeg" class="d-block w-100" alt="..."/>
          </div>
          <div class="carousel-item" data-bs-interval="2000">
            <img src="https://zom-in.com/images/banner/homepage-banner/bp-myfitbox-more-info.jpeg" class="d-block w-100" alt="..." />
          </div>
        </div>

      </div>
    )
}


export default MiddleBanner;
